import React from 'react'

class ModalEdit extends React.Component {
    constructor(props){
        super(props)
        this.state={
            errors: [],
        }
    }
    render(){
        return (
            <>
                <div className="modalCard" data-status={this.props.status}>
                    <div className="modalCard-left">
                        <img src={'http://127.0.0.1:8000'+ this.props.data.image_id}/>
                    </div>
                    <div className="modalCard-right">
                        
                    <button type="button" class="close" aria-label="Close" onClick={this.props.onClick}>
                        <span aria-hidden="true">&times;</span>
                    </button>
                    </div>
                </div>
            </>
        )
    }
}
export default ModalEdit;
